import "./App.css";
import Video from "./components/video";
import data_list from  "./data/data.js";
import header from "./components/header.js"
import Header from "./components/header.js";






function App() {

  return (
    <div className="App">
      {
        data_list.map(video =><Video
          key = {video.id}
          title={video.title}
          views={video.views}
          time={video.time}
          channel={video.channel}
          verified = {video.verified}
        ></Video>)
        <Header><Header/>
      }

    </div>
  );
}; 

export default App;
